Herz aus Glas (1976)

A small village is renowned for its &quot;Ruby Glass&quot; glass blowing works. When the foreman of the works dies suddenly without revealing the secret of the Ruby Glass, the town slides into a deep depression, and the owner of the glassworks becomes obssessed with the lost secret.


